INSERT INTO `covers` (`id`, `slug`, `title`, `sub_title`, `footer`, `instruction`, `top_logo`, `middle_logo`, `id_school_year`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES (1,NULL,NULL,NULL,NULL,NULL,'cover/20230523062540.png',NULL,1,1,'2023-05-23 06:25:42','2023-05-23 06:25:42',NULL),(2,NULL,'RAPOR SISWA','SEKOLAH MENENGAH KEJURUAN <br> (SMK)','KEMENTERIAN PENDIDIKAN, KEBUDAYAAN, RISET DAN TEKNOLOGI REPUBLIK INDONESIA <br> 2023','<p class=\"ql-align-center\"><strong>PETUNJUK PENGISIAN RAPOR</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">A.   RASIONAL</p><p class=\"ql-align-center\">Rapor merupakan dokumen yang menjadi penghubung komunikasi baik antara sekolah dengan orangtua peserta didik maupun dengan pihak-pihak lain yang ingin mengetahui tentang hasil belajar anak pada kurun waktu tertentu. Karena itu, rapor harus komunikatif, informatif, dan komprehensif (menyeluruh) memberikan gambaran tentang hasil belajar peserta didik.</p><p class=\"ql-align-center\">Kurikulum berbasis kompetensi dikembangkan sesuai dengan karakteristik masing-masing mata pelajaran. Setiap mata pelajaran memiliki dimensi yang berbeda satu dengan lainnya, sehingga orientasi pembelajaran dan penilaian adalah penguasaan kompetensi sesuai dengan dimensi masing-masing mata pelajaran. Dengan demikian, nilai pada rapor bukan nilai tunggal tetapi dikelompokkan menurut dimensi masing-masing mata pelajaran.</p><p class=\"ql-align-center\">Setiap mata pelajaran memberikan informasi secara kuantitatif maupun deskriptif tentang perkembangan belajar peserta didik, sehingga dapat diketahui lebih jelas kelebihan maupun kekurangan peserta didik tersebut. Untuk memudahkan pengisian, maka aspek-aspek penilaian pada rapor diusahakan sama dengan aspek-aspek yang tertuang dalam Standar Kompetensi mata pelajarannya.</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">B.   PENJELASAN UMUM</p><p class=\"ql-align-center\">Informasi tentang hasil belajar dalam rapor ini diperoleh dari Format Penilaian Kemajuan Belajar yang dirangkum guru selama proses pembelajaran berlangsung. Format maupun cara pengisiannya dapat dilihat dalam Buku Pedoman Penilaian.</p><p class=\"ql-align-center\">Secara umum, pengisian rapor adalah sebagai berikut:</p><p class=\"ql-align-center\">Sekolah dapat menetapkan sendiri kelengkapan dari model rapor ini, misalnya identitas peserta didik dan sekolahnya.</p><p class=\"ql-align-center\">Kotak pertama berisi nomor, nama mata pelajaran, aspek penilaian, nilai (angka dan huruf), serta catatan guru.</p><p class=\"ql-align-center\">a. Nomor merupakan nomor mata pelajaran sesuai dalam struktur kurikulum yang digunakan.</p>','cover/20230622134338FiCsX.png','cover/20230710143002eX4zX.jpeg',3,1,'2023-05-29 01:39:56','2023-07-10 14:49:39',NULL);
